window.bookSummaryJSON = "<p>You are not alone, says Part I of <i>The Urantia Book</i>. The cosmos teems with trillions of inhabited planets, heavenly worlds and spirit personalities. You are not here by accident. Divine intelligence created the human race for divine purposes. </p> <p> Highlights from Part 1 include: Who God is; where God resides; how God interacts in your life; the nature and role of the spiritual hierarchy (the Trinity, angels, archangels, Ancients of the Days, etc.); how the universe originated; how it's organized; where it is going; how you fit into it; general concepts about life after death; and why God grants you free will.</p> <p>Part II describes our local universe of 10 million inhabitable planets. In this section, you'll learn about the personalities and events in our local space region that directly affects this world and your future. Highlights from Part II include: Who Jesus was before he lived on Earth; where he lives now; how he affects your life; how the local universe you live in is organized; the nature and role of local celestial personalities; who Satan and Lucifer are; what happened in the Lucifer rebellion; why Earth struggles in confusion; what human life is like on advanced worlds; where you go after you die; what happens following your resurrection; how you'll meet loved ones and friends in the next world; how love and fairness function within the heavens; and more.</p>"; 
